    },
    {
      id: 'terms',
      title: 'Terms and Conditions',
      icon: 'ðŸ“‹',
      instructions: '[Terms and conditions, BOL, and HHG contract information will be added here]'
    },
    {
      id: 'auto',
      title: 'Auto Transport Deposits',
      icon: 'ðŸš—',
      instructions: '[Auto transport deposit instructions will be added here]'
    }
  ];

  return (
    <div className="App">
      <Header />
      <Navigation />
      <main className="main-content">
        <HeroSection />
      </main>
      {paymentMethods.map((method) => (
        <PaymentSection
          key={method.id}
          id={method.id}
          title={method.title}
          icon={method.icon}
          instructions={method.instructions}
        />
      ))}
      <Footer />
    </div>
  );
}

export default App;
